import "../css/Login.css";
import React from "react";
import { Link } from "react-router-dom";

const Login = () => {
  return (
    <div className="ui container login-container">
      <h4>Login With Your Hypothesis API Token</h4>
      <div className="login-text">
        <form className="ui form">
          <div className="field">
            <label>API Token</label>
            <input type="text" name="api-token" placeholder="API Token" />
          </div>
          <div className="field">
            <label className="api-label">
              You can generate a personal API token via Hypothesis Settings >
              Developer
            </label>
          </div>
        </form>
        <Link to="/dashboard">
          <button className="ui primary button">Set Token</button>
        </Link>
      </div>
    </div>
  );
};

export default Login;
